import NavigationButton from './../../components/NavigationButton.js'
import BackButton from './../../components/BackButton.js'
import './Design.css';

import afx2020 from './../../assets/afx-2020-preview.png'

function Design() {
  return (
      <div className="Design">
          <div className="Text">
          I've included a couple of case studies involving my most recent design projects below. Click on any one of them to find out more information!

              <div>
              <img className="Image-photo" src={afx2020} />
              </div>
          </div>

      </div>
  );
}

export default Design;
